import time

def linear_search(arr, target) -> int:
    for i in range(len(arr)):
        if arr[i] == target:
            return i
    return -1

def binary_search(arr, low, high, target) -> int:
    if high >= low:

        mid = (low + high) // 2
        
        if arr[mid] == target:
            return mid
        elif target > arr[mid]:
            return binary_search(arr, mid + 1, high, target)
        else:
            return binary_search(arr, low, mid - 1, target)
    else:
        return -1

